@jeawhanlee why did you used `$this->createMock` instead of Mockery?
I started using `$this->createMock` as last option to fix an issue with Query classes. Otherwise by convention we use Mockery as mocking library.

I was having issues mocking methods in the `queue` class, so using `$this->createMock` solved the issue.

