This looks good. However, I'd like to restructure the conditional block a little. Right now the `else` block corresponds to a very specific case: a future issue. But it's not that clear from reading the code. Can we structure this to be a little more explicit for reading?

```php
if ($issue) {
    if ($issue->getData('published')) {
        $publication->setData('status', Submission::STATUS_PUBLISHED);
        if (!$publication->getData('datePublished')) {
            $publication->setData('datePublished', $issue->getData('datePublished'));
        }
    } else {
        $publication->setData('status', Submission::STATUS_SCHEDULED);
    }
} else {
    $publication->setData('status', Submission::STATUS_PUBLISHED);
    if (!$publication->getData('datePublished')) {
        $publication->setData('datePublished', Core::getCurrentDate());
    }
}
```

It results in a little more conditional block nesting. But I think it's easier to interpret what is happening in each block.

Can you move this comment to the docblock and make it the following:

```php
/**
 * Set the status and date of publication
 *
 * A publication's status and date of publication will be set depending
 * on the issue it is assigned to. Publications in future issues should
 * be set to `STATUS_SCHEDULED`. Otherwise, they should be set to
