The initial issue that I opened was #16961.  It was closed as a duplicate of this issue, then reopened after my initial PR.  One of my concerns is that when KEYCLOAK_ADMIN is used to specify a user, an admin user isn't created if that username already exists without admin role.  This may not be a situation that occurs often.   I think it could the user some headache if the situation arises.  

@vmuzikar.  Please explain your comment about changing code in KeycloakMain instead of ApplianceBootstrap.  I'm not certhan that what you are suggesting is possible.  The code that currently checks for existing users and generates error log is in ApplianceBootstrap.  If user exists check and log message is added to KeycloakMain, then ApplianceBootrap will need also need to be modified to remove existing user check and log message.

IMHO, this part of the code is valid and should not be removed. No user should be present in the DB within bootstrapping, and only the initial admin account should be created. With the suggested changes, we can create multiple admins via ENV vars, which is not what we want. The other admins should be created only via the admin console and not via ENV vars.

My PR was indented for issue #16961, which was closed as a duplicate of #15789 at the time the PR was created.  Issue #16961 has since been reopened and I will move my PR to that issue.  ENV vars should create an admin specified even if another admin exists.  It is the only way to recover if new admin deletes the initial admin account/revokes the initial user's admin role or if the initial admin username/password is somehow lost.   In older versions of Keycloak, the ENV would create a new admin user regardless of the existence of other admin users.   This was extremely helpful because it also made Keycloak recovery from backup database possible.  If a Keycloak instance is wiped out, but a database backup exists, you can recover without knowing initial admin credentials, because a new admin account could be created with ENVs.  I strongly believe there needs to be a way to create an admin account in the event that someone loses initial admin password.

